import React from 'react';
import '../stylesheets/home.css';
import store from "../store";

console.log(store)

const Tasks = (store) => store.getState.todos.map(i =>
    <li>{i}</li>
)

function Home() {
    return (
        <div className="home">
            <ol>
                {Tasks(store)}
            </ol>
        </div>
    );
}

export default Home;
